/*Table structure for table `notas` */

DROP TABLE IF EXISTS `notas`;

CREATE TABLE `notas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idConsulta` int(11) DEFAULT NULL,
  `tipoOjo` tinyint(1) DEFAULT '1' COMMENT '1=izquierdo,2=derecho',
  `tipoImg` tinyint(1) DEFAULT '1' COMMENT '1=ginescopia,2=mecular',
  `positionTop` int(11) DEFAULT NULL,
  `positionLeft` int(11) DEFAULT NULL,
  `nota` varchar(800) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idConsulta` (`idConsulta`),
  CONSTRAINT `notas_ibfk_1` FOREIGN KEY (`idConsulta`) REFERENCES `consultas` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

